import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;

  @media (min-width: 960px) {
    flex-direction: row;
  } ;
`;

const Product = ({ product, productIndex }) => {
  return <div></div>;
};

export default Product;
